create table player_fact
(
    coach_id     integer
        references coach,
    team_id      integer
        references national_team,
    year_id      integer
        constraint player_fact_world_cup_year_fk
            references world_cup,
    player_id    integer
        references player,
    shirt_number integer,
    position     varchar
);

alter table player_fact
    owner to postgres;

create index player_fact_coach_id_idx
    on player_fact (coach_id);

create index player_fact_player_id_idx
    on player_fact (player_id);

create index player_fact_shirt_number_idx
    on player_fact (shirt_number);

create index player_fact_team_id_idx
    on player_fact (team_id);

create index player_fact_year_id_idx
    on player_fact (year_id);

grant select on player_fact to inode_readonly;

